import React from "react";
import { signOut } from "firebase/auth";
import { useHistory } from "react-router-dom";
export default ()=>{
    const history=useHistory();
    const onLogOutCLick=()=>{
        signOut();
        history.push("/");
    }
    return(
        <>
            <button onClick={onLogOutCLick}>Log Out</button>
        </>
    )
}
